    "2009-oregon-department-of-geology-and-mineral-industries-dogami-lidar-southwest-washington-studf13a3",nt"isopen":
    false,nt"url": null,nt"notes": "The Oregon Department of Geology and Mineral
    Industries (DOGAMI) contracted with Watershed Sciences, Inc. to collect high resolution
    topographic LiDAR data for multiple areas within the State of Oregon. The areas
    for LiDAR collection have been designed as part of a collaborative effort of state,
    federal, and local agencies in order to meet a wide range of project goals. This
    LiDAR data set was collected between July 26 - October 10, 2009 (in four separate
    dates of acquisition) and encompasses the coastal areas of Grays Harbor and Pacific
    counties in Oregon. This data set consists of bare earth and unclassified points.
    The average pulse density is 8.91 pulses per square meter over terrestrial surfaces.
    The area of interest (AOI) encompasses approximately 463 square miles (296,307 acres)
    and the total area flown (TAF) covers 492 square miles (315,012 acres). The TAF
    acreage is greater than the original AOI acreage due to buffering and flight planning
    optimization. In some areas of heavy vegetation or forest cover, there may be relatively
    few ground points in the LiDAR data. Elevation values for open water surfaces are
    not valid elevation values because few LiDAR points are returned from water surfaces.
    LiDAR intensity values were also collected. The dates of acquisition for this data
    set are: July 26 - August 1, 2009 September 20 - 26, 2009 September 27 - October
    3, 2009 October 4 - 10, 2009",nt"license_title": null,nt"extras": [{ntt"key":
